body{
    font-family: "メイリオ",Meiryo,"ヒラギノ角ゴ Pro W3";
}

span.catch_copy{
line-height:110%;
letter-spacing:0.1em;
}

span.item_name{
line-height:110%;
letter-spacing:0.1em;
}

 <!--
 /*項目選択肢名*/
 span.choice{
	 font-size:100%;
 }

/*選択項目肢スタイル*/
#rakutenLimitedId_aroundCart *{
    line-height: 1.4;
}

span.choice {
    color: #000000;
    display: block;
    font-size: 14px !important;
    padding: 5px;
    margin-bottom: 5px;
    border: solid 1px #ddd;
    background: #f0f0f0;
    width: 300px;
    font-weight: bold;
    letter-spacing:0.1em;
}

select[name="choice"]{
	height:30px;
        padding:5px;
        line-height:1.5;
}


 /*商品ページ価格*/
 span.price1{
	 font-size:100%;
 }
 span.price2{
	 font-size:130%;
	 font-weight:bold;
 }

/*目玉商品*/
td.lossleader_item_name{
font-size:10px;
width:155px;
height:30px;
overflow:hidden;
padding:15px;
}
span.lossleader_price2{
color:#df0000;
}

/* 高さ幅などを各店舗ごとに任意に指定してください */
.subcategory_list {
display:none !important;
}

a.subcategory_list {

display: block !important;
text-decoration: none;
height: 30px; /* 店舗ごとに任意 */
width: 240px; /* 店舗ごとに任意 */
margin-top: 10px; /* 店舗ごとに任意 */
margin-bottom:10px;
padding-top: 15px; /* 店舗ごとに任意 */
line-height:20px; /* 店舗ごとに任意 */
text-align: center; /* 店舗ごとに任意 */
}


/* マウスオーバー時のあしらいを設定 */
a.subcategory_list:hover {
filter:alpha(opacity=50); /* マウスオーバーで50%の透明になるように指定しています */
-moz-opacity: 0.5;
opacity: 0.5;
}

/* マウスオーバー時のあしらいを設定 */
a:hover{
filter:alpha(opacity=50); /* マウスオーバーで50%の透明になるように指定しています */
-moz-opacity: 0.5;
opacity: 0.5;
}


td.sdtext {
	color: #414141;
	font-size: 11px;
}
td.sdtext a:link {
	color: #414141;
}
td.sdtext a:link {
	color: #333;
}
td.sdtext a:hover {
	color: #069;
}
td.breadcrumbs_list {
	color: #414141;
}
a.breadcrumbs_list:link {
	color: #414141;
}
a.breadcrumbs_list:hover {
	color: #069;
}
#risFil .risfFootWrap {
	margin: 50px 0 0 0;
	clear: both;
}
#risFil table a {
	color: #333;
	padding: 10px 20px;
}
#risFil table a:hover {
	text-decoration: no;
}
#risFil tr td a.category_itemnamelink {
	width: 190px;
	height: 5.4em;
	font-size: 11px;
	line-height: 1.5em;
	display: block;
	text-align: left;
	overflow: hidden;
}
:root #risFil tr td a.category_itemnamelink {
	height: 3.5em;
}
span.category_itemprice, span.category_itemtaxpostage {
	font-size: 12px;
	font-weight: bold;
	line-height: 1.5em;
	color: #C00;
	padding: 10px 0 0 0;
}
#risFil table tbody tr td br {
	display: none;
}
#risFil table tbody tr td {
	background: url() left bottom no-repeat;
}
#risFil table tbody tr td:first-child {
	background: none;
}
#risFil table tbody tr td a img {
	margin: 50px 0 0 0;
}
#risFil table tbody tr td span.category_itemprice {
	font-size: 12px;
}
#risFil table tbody tr td span.not {
	font-size: 12px;
}
#risFil table tbody tr td span.category_itemtaxpostage {
	font-size: 12px;
}
#risFil table tbody tr td div.risfClfx {
	font-size: 12px;
}

#rnkInShopMain {
	overflow: hidden;
	height: 300px;
}
iframe#head_navi {
	width: 960px;
	height: 40px;
	margin: 0;
	padding: 0;
	position: relative;
	z-index: 2;
}
iframe#header_frame {
	margin: 0;
	height: 500px;
	position: relative;
	z-index: 1;
}

.syo-tokucho{
color:#333333;
font-size:15px;
font-weight:bold;
letter-spacing:0.1em;
line-height:120%;
}
.syo-setsu{
color:#666666;
font-size:13px;
line-height:120%;
}

